package advent.y2018;

import advent.Util;

public class Day05 {
    private static final String[] DOUBLETS = {"Aa","aA","Bb","bB","Cc","cC","Dd","dD","Ee","eE","Ff","fF","Gg","gG",
            "Hh","hH","Ii","iI","Jj","jJ","Kk","kK","Ll","lL","Mm","mM","Nn","nN","Oo","oO","Pp","pP","Qq","qQ",
            "Rr","rR","Ss","sS","Tt","tT","Uu","uU","Vv","vV","Ww","wW","Xx","xX","Yy","yY","Zz","zZ"
    };

    public static void main(String[] args) {
        
        String now = DATA;
        now = react(now);
        Util.log("Part 1: now is %d long",  now.length());

        boolean n = false;
        int shortest = Integer.MAX_VALUE;
        String badBoy = null;
        for (String doub : DOUBLETS) {
            n = n?false:true;
            if (n) {
                continue;
            }
            now = DATA;
            now = now.replaceAll(doub.substring(0,1), "");
            now = now.replaceAll(doub.substring(1), "");
            now = react(now);
            if (shortest > now.length()) {
                badBoy = doub;
                shortest = now.length();
                System.out.print("!");
            }
            else {
                System.out.print(".");
            }
        }
        Util.log("\nPart 2: trimming %s results in %d when fully reacted", badBoy, shortest);
    }

    private static String react(String now) {
        int n0;
        do {
            n0=now.length();
            for (String doub : DOUBLETS) {
                now = now.replaceAll(doub, "");
            }
        } while (n0 > now.length());
        return now;
    }

    private static final String DATA="";
}
